import{_ as t,o as p,c as e,a as s}from"./app.dad05bb1.js";const i={},a=s("<p>通过git stash将工作区恢复到上次提交的内容，同时备份本地所做的修改，之后就可以正常git pull了，git pull完成后，执行git stash pop将之前本地做的修改应用到当前工作区。 git stash git pull git stash pop</p><p>看到这里有些人就懵逼了，我也一样，使用SourceTree的对于git命令的就是白痴的，下面我就介绍一下这三行代码代表什么意思吧；</p><p>git stash: 备份当前的工作区的内容，从最近的一次提交中读取相关内容，让工作区保证和上次提交的内容一致。同时，将当前的工作区内容保存到Git栈中。</p><p>git pull:拉取服务器上的代码；</p><p>git stash pop: 从Git栈中读取最近一次保存的内容，恢复工作区的相关内容。由于可能存在多个Stash的内容，所以用栈来管理，pop会从最近的一个stash中读取内容并恢复。</p><p>git stash list: 显示Git栈内的所有备份，可以利用这个列表来决定从那个地方恢复。</p><p>git stash clear: 清空Git栈。此时使用gitg等图形化工具会发现，原来stash的哪些节点都消失了。</p><p>希望能帮到大家</p><p>2021年6月20日1</p><p>问题1</p><p>fatal: unable to access &#39;https://github.com/baoshan2020/www.git/&#39;: OpenSSL SSL_read: Connection was reset, errno 10054</p><p>D:\\hugo\\www&gt;git push -u origin master fatal: unable to access &#39;https://github.com/baoshan2020/www.git/&#39;: OpenSSL SSL_read: Connection was reset, errno 10054</p><p>D:\\hugo\\www&gt;git config --global http.sslVerify &quot;false&quot;</p><p>解决方法</p><p>git config --global http.sslVerify “false”</p><p>问题2：</p><p>D:\\hugo\\www&gt;git push -u oringin master fatal: &#39;oringin&#39; does not appear to be a git repository fatal: Could not read from remote repository.</p><p>git remote add origin git@github:bx_reader/bx-reader-api.git</p>",18),o=[a];function g(r,n){return p(),e("div",null,o)}const h=t(i,[["render",g],["__file","git1.html.vue"]]);export{h as default};
